window.bookSummaryJSON = "The apprenticeship is over - now the real test has begun. <p>When word that Yelena is a Soulfinder - able to capture and release souls - spreads like wildfire, people grow uneasy. Already Yelena's unusual abilities and past have set her apart. As the Council debates Yelena's fate, she receives a disturbing message: a plot is rising against her homeland, led by a murderous sorcerer she has defeated before....</p> <p>Honor sets Yelena on a path that will test the limits of her skills, and the hope of reuniting with her beloved spurs her onward. Her journey is fraught with allies, enemies, lovers, and would-be assassins, each of questionable loyalty. Yelena will have but one chance to prove herself - and save the land she holds dear.</p>"; 
